  \"VHA Support Service Center Electronic Wait List (EWL)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 310,\n\t\t\"recent\": 14\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-08-21T22:54:41.663034\",\n\t\"name\": \"vha-support-service-center-electronic-wait-list-ewl\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The goal of the Electronic Wait List (EWL)
  is to provide care to the patient as quickly as possible. To facilitate this goal,
  patients may be placed on a Wait List for a different team or even at a different
  facility. The EWL keeps track of appointments, clinics, and providers associated
  with patients on the various EWL. Patient eligibility information and service connected
  status is also recorded and updated. EWL is able to determine a status change in
  the veteran's service connected percentage and service connected priority. As well
  as changes to appointment, clinics, and personnel that affect Wait List patients.
  EWL is able to provide email notifications regarding status changes to assigned
  mail groups. In the outpatient setting, patients are assigned a primary care team
  and provider who are responsible for delivering essential health care, coordinating
  all health care services, and serving as the point of access for specialty care.
  This is accomplished through the Primary Care Management Module (PCMM) of the Veterans
  Health Information Systems and Technology Architecture (VistA). When a patient cannot
  be assigned to a primary care team or position, the PCMM software asks if the patient
  should be placed on the EWL.  PCMM Wait List reports assist in the management of
  patients awaiting a primary care team or provider assignment. The EWL can also produce
  reports on demand regarding EWL related activities. Displays Veterans Waiting on
  the Electronic Wait List by VISN or Station. Includes Veterans last name, last four
  digits of social security number, zip code, percent service connected and enrolled
  status.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
